import React from 'react';
import { motion } from 'framer-motion';
import { ChevronDown, Github, Linkedin, Mail, Download } from 'lucide-react';
import { useInView } from 'react-intersection-observer';

const Hero = () => {
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });
  const resumeUrl = process.env.PUBLIC_URL + '/Resume.pdf';

  const socialLinks = [
    { icon: Github, href: 'https://github.com/TheOnlyBaddy', label: 'GitHub' },
    { icon: Linkedin, href: 'https://www.linkedin.com/in/shubh-barnwal', label: 'LinkedIn' },
    { icon: Mail, href: 'mailto:barnwalshubh8002434@gmail.com', label: 'Email' },
  ];

  const scrollToNext = () => {
    const aboutSection = document.querySelector('#about');
    if (aboutSection) {
      aboutSection.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <section id="home" className="section-padding relative overflow-hidden section-divider">
      {/* Background with subtle blur */}
      <div className="absolute inset-0 bg-gradient-to-br from-gray-50/80 via-white/90 to-gray-100/80 dark:from-dark-800/80 dark:via-dark-700/90 dark:to-dark-800/80 backdrop-blur-[2px]"></div>

      {/* Decorative background elements */}
      <div className="absolute inset-0 overflow-hidden pointer-events-none">
        <div className="absolute top-10 right-10 w-64 h-64 bg-gradient-to-r from-green-400/10 to-blue-400/10 rounded-full blur-2xl float-animation"></div>
        <div className="absolute bottom-10 left-10 w-80 h-80 bg-gradient-to-r from-orange-400/10 to-red-400/10 rounded-full blur-2xl float-animation" style={{animationDelay: '3s'}}></div>
        <div className="absolute top-1/2 left-20 w-32 h-32 bg-gradient-to-r from-yellow-400/8 to-orange-400/8 rounded-full blur-xl float-animation" style={{animationDelay: '1.5s'}}></div>
      </div>

      <div className="container-custom relative z-10">
        <motion.div
          ref={ref}
          initial={{ opacity: 0, y: 50 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8 }}
          className="text-center"
        >
          {/* Greeting */}
          <motion.p
            className="text-lg text-primary-600 dark:text-primary-400 mb-2"
            initial={{ opacity: 0, y: 20 }}
            animate={inView ? { opacity: 1, y: 0 } : {}}
            transition={{ duration: 0.6, delay: 0.2 }}
          >
            Hello, I'm
          </motion.p>

          <motion.h1
            className="text-5xl md:text-7xl font-bold text-dark-900 dark:text-white mb-4"
            initial={{ opacity: 0, y: 20 }}
            animate={inView ? { opacity: 1, y: 0 } : {}}
            transition={{ duration: 0.8, delay: 0.4 }}
          >
            <span className="gradient-text">Shubh Barnwal</span>
          </motion.h1>

          <motion.h2
            className="text-2xl md:text-3xl font-semibold text-dark-700 dark:text-dark-300 mb-8"
            initial={{ opacity: 0, y: 20 }}
            animate={inView ? { opacity: 1, y: 0 } : {}}
            transition={{ duration: 0.8, delay: 0.6 }}
          >
            Full Stack Developer
          </motion.h2>

          {/* Description */}
          <motion.p
            className="text-lg text-dark-600 dark:text-dark-400 max-w-3xl mx-auto mb-12"
            initial={{ opacity: 0, y: 20 }}
            animate={inView ? { opacity: 1, y: 0 } : {}}
            transition={{ duration: 0.8, delay: 0.8 }}
          >
            I craft digital experiences with clean code and innovative solutions. 
            Passionate about building scalable applications and turning ideas into reality.
          </motion.p>

          {/* CTA Buttons */}
          <motion.div
            className="flex flex-wrap justify-center gap-4"
            initial={{ opacity: 0, y: 20 }}
            animate={inView ? { opacity: 1, y: 0 } : {}}
            transition={{ duration: 0.8, delay: 1.0 }}
          >
            <motion.div 
              className="relative group"
              whileHover={{ y: -2 }}
              whileTap={{ scale: 0.98 }}
            >
              <div className="absolute -inset-1 bg-gradient-to-r from-primary-500 to-cyan-500 rounded-full blur opacity-20 group-hover:opacity-30 transition-all duration-300"></div>
              <motion.a
                href={resumeUrl}
                download
                className="relative px-8 py-3.5 bg-gradient-to-r from-primary-600 to-cyan-600 text-white font-semibold rounded-full shadow-lg hover:shadow-xl transition-all duration-300 flex items-center justify-center gap-2 group-hover:from-primary-500 group-hover:to-cyan-500"
              >
                <motion.span 
                  className="inline-block group-hover:translate-y-[-2px] transition-transform duration-300"
                  initial={false}
                >
                  <Download className="h-5 w-5" />
                </motion.span>
                <span>Download CV</span>
              </motion.a>
            </motion.div>
            <motion.div 
              className="relative group"
              whileHover={{ y: -2 }}
              whileTap={{ scale: 0.98 }}
            >
              <div className="absolute -inset-1 bg-gradient-to-r from-purple-500 to-pink-500 rounded-full blur opacity-20 group-hover:opacity-30 transition-all duration-300"></div>
              <motion.button
                className="relative px-8 py-3.5 bg-gradient-to-r from-dark-800 to-dark-700 text-white dark:from-dark-700 dark:to-dark-800 font-semibold rounded-full shadow-lg hover:shadow-xl transition-all duration-300 flex items-center justify-center gap-2 group-hover:from-dark-700 group-hover:to-dark-600 dark:group-hover:from-dark-600 dark:group-hover:to-dark-700 border border-gray-200 dark:border-dark-600"
                onClick={() => {
                  const el = document.querySelector('#projects');
                  if (el) el.scrollIntoView({ behavior: 'smooth' });
                }}
              >
                <span>View Projects</span>
                <motion.span 
                  className="inline-block group-hover:translate-x-1 transition-transform duration-300"
                  initial={false}
                >
                  <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5" viewBox="0 0 20 20" fill="currentColor">
                    <path fillRule="evenodd" d="M10.293 5.293a1 1 0 011.414 0l4 4a1 1 0 010 1.414l-4 4a1 1 0 01-1.414-1.414L12.586 11H5a1 1 0 110-2h7.586l-2.293-2.293a1 1 0 010-1.414z" clipRule="evenodd" />
                  </svg>
                </motion.span>
              </motion.button>
            </motion.div>
          </motion.div>

          {/* Social Links */}
          <motion.div
            className="flex items-center justify-center gap-6 pt-8"
            initial={{ opacity: 0, y: 30 }}
            animate={inView ? { opacity: 1, y: 0 } : {}}
            transition={{ duration: 0.8, delay: 1.6 }}
          >
            {socialLinks.map((social, index) => (
              <motion.a
                key={social.label}
                href={social.href}
                className="p-3 bg-gray-100 dark:bg-dark-800 hover:bg-primary-100 dark:hover:bg-primary-900/20 rounded-full transition-all duration-300 group"
                whileHover={{ scale: 1.1, y: -2 }}
                whileTap={{ scale: 0.95 }}
                initial={{ opacity: 0, scale: 0 }}
                animate={inView ? { opacity: 1, scale: 1 } : {}}
                transition={{ duration: 0.4, delay: 1.8 + index * 0.1 }}
              >
                <social.icon className="h-6 w-6 text-dark-600 dark:text-dark-400 group-hover:text-primary-600 dark:group-hover:text-primary-400 transition-colors duration-300" />
              </motion.a>
            ))}
          </motion.div>
        </motion.div>
      </div>

      {/* Scroll Indicator */}
      <motion.div
        className="absolute bottom-8 left-1/2 transform -translate-x-1/2"
        initial={{ opacity: 0, y: 20 }}
        animate={inView ? { opacity: 1, y: 0 } : {}}
        transition={{ duration: 0.8, delay: 2.0 }}
      >
        <motion.button
          onClick={scrollToNext}
          className="p-2 text-dark-600 dark:text-dark-400 hover:text-primary-600 dark:hover:text-primary-400 transition-colors duration-300"
          animate={{ y: [0, 10, 0] }}
          transition={{ duration: 2, repeat: Infinity }}
        >
          <ChevronDown className="h-6 w-6" />
        </motion.button>
